import React, { Component } from "react";

class ListContainer extends Component {
  state = {
    dogs: []
  };

  componentDidMount() {
    fetch("http://localhost:3000/dogs")
      .then(resp => resp.json())
      .then(data =>
        this.setState({
          dogs: data
        })
      );
  }

  render() {
    console.log(this.state.dogs);
    return <h1>Print Something</h1>;
  }
}

export default ListContainer;
